export default {
  props: {
    id: ""
  },
  data: function data() {
    return {
      form: {
        name: "",
        grade: "",
        description: "",
        remark: ""
      },
      rules: {
        name: [{
          required: true,
          trigger: "blur",
          message: "不能为空"
        }]
      }
    };
  },
  mounted: function mounted() {},
  methods: {
    ADD: function ADD() {
      var _this = this;

      this.$confirm("是否确认新增内容", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(function () {
        if (!_this.form.name) {
          _this.$message({
            type: "error",
            message: "必填项未输入，新增用户失败"
          });

          return;
        } else {
          _this.axios.post('/guanqu/web/sys-roles/', {
            name: _this.form.name,
            grade: _this.form.grade,
            description: _this.form.description,
            remark: _this.form.remark
          }).then(function (res) {
            _this.$message({
              type: "success",
              message: "新增用户成功!"
            });

            _this.$emit("closewindows");
          });
        }
      }).catch(function () {// this.$message({
        //   type: "error",
        //   message: "网络错误！新增用户失败！"
        // });
      });
    },
    del: function del() {
      this.$emit("closewindows");
    }
  },
  computed: {},
  watch: {}
